import styles from "./ContentContainer.module.css";

// prettier-ignore
const data = `{
  "symbols":[["Apple", "AAPL|1D"],
  ["Google", "GOOGL|1D"]
  ],
  "chartOnly": false,
  "width": "700",
  "height": "450",
  "locale": "en",
  "colorTheme": "dark",
  "autosize": false,
  "showVolume": false,
  "showMA": false,
  "hideDateRanges": false,
  "hideMarketStatus": false,
  "hideSymbolLogo": false,
  "scalePosition": "right",
  "scaleMode": "Normal",
  "fontFamily": "-apple-system, BlinkMacSystemFont, Trebuchet MS, Roboto, Ubuntu, sans-serif",
  "fontSize": "10",
  "noTimeScale": false,
  "valuesTracking": "1",
  "changeMode": "price-and-percent",
  "chartType": "line",
  "maLineColor": "#2962FF",
  "maLineWidth": 1,
  "maLength": 9
}`;

export default function ContentContainer() {
  const [stockData, setStockData] = useState(data);

  const handleSubmit = (e) => {
    e.preventDefault();
    // 서버로 보내는 로직 하나
    setQeustion("");
  };

  const PushData = () => {
    let JsonData = JSON.parse(stockData);
    JsonData.symbols.push(["Microsoft", "MSFT|1D"]);
    let LastData = JSON.stringify(JsonData);
    setStockData(LastData);
  };

  console.log(stockData);

  return (
    <>
      <div className={styles.stockArea}>
        {/* <div className={styles.stockGraph}></div> */}
        <StockWidget data={stockData} />
        <button
          onClick={() => {
            PushData();
          }}
        >
          asdfasdf
        </button>
        <button
          onClick={() => {
            setStockData(data);
          }}
        >
          CHO
        </button>
        <div className={styles.stockEx}>
          <h5>향후 전망?</h5>
          <h5 style={{ color: "white" }}>{stockData.symbols}</h5>
        </div>
      </div>
      <div className={styles.searchArea}>
        <AutoComplete />
      </div>
    </>
  );
}
